import React , {useState} from "react";
import ChrinkedForm from "./ChrinkedForm";
import './SaveNewItem.css';
import ItemForm from "./ItemForm";
const SaveNewItem =(props)=> {
    let swap = '';
    const SaveDataHandler =(InputNewData)=> {
        const AddData = {
            ...InputNewData,
            id: Math.random().toString()};
        console.log(AddData);
        props.onSave(AddData);

    };

    if (swap == ''){
        return (
            <div>
                <div className="newItem">
                    <ChrinkedForm change={ToFormHandle}/>
                </div>
            </div>
        )
    }

    //const bb = <ItemForm OnSaveData={SaveDataHandler}/>
    const ToFormHandle=()=>{
       return <ItemForm OnSaveData={SaveDataHandler}/>};
    
}

export default SaveNewItem;
